$("#search").autocomplete({
  source: suggestions,
  minLength: 0,
  select: function( event, ui ) {
	play(event, ui.item.value, ui.item.name, ui.item.channel_id, ui.item.isHD, ui.item.isCatchupAvailable, ui.item.name);
	$("#search").val("");
  }
});

